import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import RepositoryList from './components/RepositoryList';
import Axios from 'axios';
import { ReleaseResponse, RepositoryResponse } from './data-objects/Repository';
import { AppBar, createMuiTheme, ThemeProvider } from '@material-ui/core';


const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#1f072c'
    },
    secondary: {
      main: '#64b5f6'
    },
  }

})


const App: React.FC = props => {
  const [repos, setRepos] = useState<RepositoryResponse[]>([])

  const getRepos = async () => {
    Axios.get("https://api.github.com/users/CPlusPlusCompiler/repos")
      .then(response => response.data)
      .then(data => setRepos(data))
      .catch(error => console.error(error))
  }

  useEffect(() => {
    console.log("fetching repositories")
    getRepos()
  }, [])

  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <AppBar position="sticky">
          <p>Andrius' portfolio</p>
        </AppBar>

        <header>
          <p>
            Android development, Kotlin, Java
            Threads and coroutines
            SQLite both raw queries and Room library
            TCP sockets, Http requests, Retrfoit
            C++ Qt5/QML (desktop and mobile applications)
            Creating applications to work with hardware devices (card readers, printers)
            Common markdown languages: Json, XML
            Html, Css
          </p>
        </header>

        {RepositoryList(repos)}
      </ThemeProvider>


    </div>
  );
}



export default App;
